import React, { Component } from 'react';

export default class Sign extends Component {
    render() {
        return (
            <div id="sign">
                <div class="tab">
                    <form action="/loginteachers" method="post">
                        <ul>
                            <li><label for="name">Имя</label>
                                <input type="text" name="name"/></li>
                            <li><label for="password">Пароль</label>
                                <input type="password" name="password"/></li>
                            <li id="radio">
                                <label for="teach">Учитель</label>
                            <input type="radio" id="teach" name="group"/>
                                <label for="teach">Учитель</label>
                                <input type="radio" id="stud" name="group"/>
                                <label for="stud">Ученик</label></li>
                            <li><button type="submit">Войти</button></li>
                        </ul>
                    </form>
                </div>
               
            </div>
        );
    }
}
